import React from "react";

import Navbar from "../../components/navbar";

import Typography from "@material-ui/core/Typography";

class Contact extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <Typography>Contact</Typography>
      </div>
    );
  }
}

export default Contact;
